import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import "./App.css";

export default function App() {
  return (
    <Router>
      <div>
        <nav className="madiv">
          <ul>
            <li>
              <Link to="/">HOME</Link>
            </li>

            <li>
              <Link to="/About">ABOUT ME</Link>
            </li>

            <li>
              <Link to="/Resume">RESUME</Link>
            </li>

            <li>
              <Link to="/Portfolio">PORTFOLIO</Link>
            </li>

            <li>
              <Link to="/Blog">BLOG</Link>
            </li>

            <li>
              <Link to="/Contact">CONTACT</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/About">
            <About />
          </Route>

          <Route path="/Resume">
            <Resume />
          </Route>

          <Route path="/Portfolio">
            <Portfolio />
          </Route>

          <Route path="/Blog">
            <Blog />
          </Route>

          <Route path="/Contact">
            <Contact />
          </Route>

          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <div className="accueil">
      <h4>Hello, I am </h4>
      <h2>AMRI</h2>
      <h4>
        I am
        <strong> Developer Web. Passionate about IT .</strong>
      </h4>
    </div>
  );
}

function About() {

  return (<div>

      <section>

          <lu>
                  <div className="section1">HTML, CSS & JAVASCRIPT, PHP, JAVA...

                    <p>I have a lot of experience of working experience doing front end development.</p>
                    <p>I can build impressive UIs using these fundamental web development languages.</p>

                  </div>

                  <div className="section2">REACT JS</div>

                  <div className="section3">REACT NATIVE
                     <p></p>
                 </div>

                  <div className="section4">PERFORMANCE & SCALING</div>
          </lu>

      </section>

  </div>);

}

function Resume() {
  return <h2>resume</h2>;
}

function Portfolio() {
  return <h2>portfolio</h2>;
}

function Blog() {
  return <h2>blog</h2>;
}

function Contact() {
  return <h2>contact</h2>;
}
